import React, { Component } from "react";
import ReactDOM from "react-dom";
import Grid from "@material-ui/core/Grid";
import HospCards from "./HospCards";

export default (props) => (
  <Grid container>
    <Grid item xs={6}>
      <HospCards />
    </Grid>

    <Grid item xs={6}>
      map
    </Grid>
  </Grid>
);
